    const cargarLocalidades = function(data) {

      $('#checkout_shipping_address_city').empty();

      $('#checkout_shipping_address_city').append($.parseHTML("<option selected='true' disabled='' data-option-default='true'>"
                              + "Seleccionar comuna"
                          + "</option>"));

      data.forEach(function(comuna) {
          $('#checkout_shipping_address_city').append($.parseHTML("<option value='"+ comuna.nombre +"' data-id='"+ comuna.id + "'>"+ comuna.nombre +"</option>"));
      });

      $('#checkout_shipping_address_city').removeClass('shypgenius__input-disabled');

    }

    const cargarSucursales = function(data) {

      $('#checkout_shipping_sucursal').empty();

      $('#checkout_shipping_sucursal').append($.parseHTML("<option selected='true' disabled='' data-option-default='true'>"
                              + "Seleccione una sucursal"
                          + "</option>"));

      data.forEach(function(sucursal) {
          $('#checkout_shipping_sucursal').append($.parseHTML("<option value='"+ sucursal.domicilio +"' data-id='"+ sucursal.id + "' data-correo='"+ sucursal.correo +"' data-nombre='"+ sucursal.nombre +"'>"+ sucursal.nombre +" (" + sucursal.domicilio + ")</option>"));
      });

      $('#checkout_third_party_locations').removeClass('shypgenius__input-disabled');

    }

    $(document).on('change', '#checkout_shipping_address_province', function () {
      const province = $(this).val();

      $.ajax({
        url: "https://api-cl.enviopack.com/extensiones/shopify/localidades",
        method: 'GET',
        data: {provincia: province},
        dataType: 'JSONP',
        crossDomain: true,
        jsonpCallback: 'cargarLocalidades',
        contentType: "application/json; charset=utf-8",
        beforeSend: function() {
          $('#checkout_shipping_address_city').addClass('shypgenius__input-disabled');
        },
        success: cargarLocalidades
      });
    });


